import { useSelector } from "../../CustomStore/hooks/useSelector"

export const Cart = () => {
 const newCart = useSelector((state) => state.cart || {});

  return (
    <div>
      <div>Cart</div>
      <div>
      {Object.keys(newCart)
        .filter()
       .map((key) => (
        <div key={key}>
          <span>{key}</span>
          <span>{newCart[key]}</span>
        </div>
      ))}
      </div>
    </div>
  )
}
